import React from 'react';

export default function Project() {
    return (
    <section id="projects" className="projects">
      <h2>My Projects</h2>
      <div className="project-list">
        <div className="project-item">
          <h3>To access my projects</h3>
          <p>Project Description</p>
        </div>
       
      </div>
    </section>
  );
}
